} If your plugin doesn't provide components: impl Plugin for ComparisonPluginImpl { fn get_component_provider(&self) -> Result<Arc<dyn ComponentProvider>, PluginError> { Err(PluginError::NoComponentProvider) }
} The same applies to all other providers: ComponentProvider EntityTypeProvider RelationTypeProvider EntityBehaviourProvider RelationBehaviourProvider FlowProvider WebResourceProvider

